import React from "react";
import './header.css'

function header(props) {
    return (
        <header>
            <div class="dropdown">
                <button type="button" className="btn btn-primary" data-bs-toggle="dropdown">
                <svg xmlns="http://www.w3.org/2000/svg" width="40" height="40" fill="currentColor" className="bi bi-justify" viewBox="0 0 16 16">
                <path fill-rule="evenodd" d="M2 12.5a.5.5 0 0 1 .5-.5h11a.5.5 0 0 1 0 1h-11a.5.5 0 0 1-.5-.5m0-3a.5.5 0 0 1 .5-.5h11a.5.5 0 0 1 0 1h-11a.5.5 0 0 1-.5-.5m0-3a.5.5 0 0 1 .5-.5h11a.5.5 0 0 1 0 1h-11a.5.5 0 0 1-.5-.5m0-3a.5.5 0 0 1 .5-.5h11a.5.5 0 0 1 0 1h-11a.5.5 0 0 1-.5-.5"/>
                </svg>

                </button>
                <div className="dropdown-menu">
                    <button className="dropdown-item" type="button">Action</button>
                    <button className="dropdown-item" type="button">Another action</button>
                    <a  className="dropdown-item" href="https://www.facebook.com/franciel.frc.5/" target="blank">facebook</a>
                </div>
            </div>

            <div className="logo"><h1>{props.name}</h1></div>
            

        </header>
    );
  }
export default header;
